#内部字典名，也即schema所引用的字典名，确保与文件名相一致
name: wubi06.symbol
version: "201812051212"
#字典初始排序，可选original或by_weight
sort: by_weight
use_preset_vocabulary: false
#定义表以Tab分隔出的各列，可设text【文本】、code【五笔编码】、weight【候选频率】、stem【造词码】
columns:
  - text
  - code
  #- weight
  #- stem
encoder:
  #取消某编码的造词资格
  exclude_patterns:
    - '^z.*$'
  rules:
    #两字词：取每字全码的前两码組成，共四码
    - length_equal: 2
      formula: "AaAbBaBb"
    #三字词：前两個字各取第一码，最后一字取前两码，共四码
    - length_equal: 3
      formula: "AaBaCaCb"
    #多字词：取第一、二、三及末一個汉字的第一码，共四码
    - length_in_range: [4, 10]
      formula: "AaBaCaZa"
